import './style.css';
import Title from '../Title/Title';

function UserCard({userData}) {
  return (
    <div className='UserCard'>
      <img src={userData.avatar_url} alt="userAvatar" className='userAvatar'/>
      <br/>
      <div className="name">
        <Title level={2} content={userData.name}  className={'a'}/>
        <Title level={3} content={userData.login} className={'a'}/>
      </div>
      <p className='card'>logo followers: <span>{userData.followers}</span> . following: <span>{userData.following}</span></p>
    </div>
  )
}

export default UserCard
